import React from "react";
import "./about.css";

const About = () => {
  return (
    <div className="whatmedical section__margin" id="about">
      <div className="whatmedical-heading">
        <h1>Give us a call!</h1>
        <p>(403)-229-1700</p>
      </div>
      <div className="whatmedical-container"></div>
    </div>
  );
};

export default About;
